import '../../public/assets/vendor/flot/excanvas.min.js';
import '../../public/assets/vendor/flot/jquery.flot.js';
import '../../public/assets/vendor/flot/jquery.flot.pie.js';
import '../../public/assets/vendor/flot/jquery.flot.resize.js';
import '../../public/assets/vendor/flot/jquery.flot.time.js';
import '../../public/assets/vendor/flot-tooltip/jquery.flot.tooltip.min.js';
import '../../public/assets/data/flot-data.js';
import '../../public/assets/dist/js/sb-admin-2.js';

import React, { PureComponent } from 'react';
import LineChart from './LineChart';
import PieChart from './PieChart';
import AxesLineChart from './AxesLineChart';
import MovingLineChart from './MovingLineChart';
import BarChart from './BarChart';
import Documentation from './Documentation';

class FlotCharts extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    componentDidMount() {
        document.title = "Flot Charts";
        document.getElementById("pageTitle").innerHTML = "Flot Charts";
    }
    render() { 
        return ( 
            <React.Fragment>
                {/* <!-- /.row --> */}
                <div className="row">
                    <LineChart />
                    <PieChart />
                    <AxesLineChart />
                    <MovingLineChart />
                    <BarChart />
                    <Documentation />
                </div>
                {/* <!-- /.row --> */}
            </React.Fragment>
         );
    }
}

export default FlotCharts;
